.amap-wrapper{
  position: relative;
  width: 100%;
  height: calc(100vh - 80px);
}

.amap-box{

  .amap-marker{

    .amap-marker-label{
      border: none !important;
      background-color: rgba(47,49,83,0.6) !important;
      padding: 8px !important;
      color: #fff;
      border-radius: 2px;
    }

    .line-marker{
      height: 20px;
      width: 20px;
      border-radius: 10px;
      background-color: rgba(63,106,255, .7);
      text-align: center;
      line-height: 20px;
      margin-top: 20px;
      color: #fff;
    }
  }
}

.car-alarm{
  position: absolute;
  left: 50px;
  top: 20px;
  height: 42px;
  font-size: 12px;
  padding-left: 32px;

  img{
    position: absolute;
    left: 0;
    top: 0;
  }

  .alarm-info{
    color: #fff;
    height: 26px;
    line-height: 26px;
    padding: 0 20px;
    margin-top: 10px;
    border-radius: 0 13px 13px 0;
    background-color: rgba(239,93,78,.7);
  }
}

.line-all{
  position: absolute;
  right: 15px;
  bottom: 15px;
  width: 375px;
  height: 85%;
  color: #fff;
  font-size: 14px;
  background:rgba(47,49,83,.5);
  border-radius: 5px;
  text-align: center;
  overflow: hidden;
  padding: 10px 0;

  .horizontal-collapse-transition {
    transition: 0s width ease-in-out, 0s padding-left ease-in-out, 0s padding-right ease-in-out;
  }

  .line-scrollbar-wrapper {
    overflow-x: hidden !important;
  }

  .el-scrollbar__bar.is-vertical {
    left: 0;
  }

  .el-scrollbar {
    height: 100%;
  }

  .line-datalist,
  .line-detailslist{
    width: 94%;
    margin: 0 auto;
  }

  .line-datalist:before{
    content: '车船路线';
    width: 100%;
    height: 34px;
    line-height: 44px;
  }

  .line-active{
    background-color: rgba(47,49,83,.9);
  }

  .line-detailslist:before{
    content: '车船信息详情';
    width: 100%;
    height: 44px;
    line-height: 44px;
    font-size: 14px;
    position: relative !important;
    background-color: transparent !important;
  }

  .el-table{
    color: #fff;
    font-size: 12px;
    background-color: transparent !important;
  }

  .pagination{
    width: 100%;
    height: 28px;
    text-align: right;
    margin-top: 12px;
    padding-right: 12px;

    div{
      display: inline-block;
      margin-left: 15px;
      border-radius: 4px;
      cursor:pointer;
    }
  }
}
